import jsPDF from 'jspdf';
import 'jspdf-autotable';
const imageURL = 'data:image/jpeg;base64,';
    
// Exporta PDF de patrullajes filtrados por usuario
const exportPatrolsPdf = (patrols,reportTitle) => {
    const doc = new jsPDF();
     console.log(patrols);
    // Añadir un rectángulo de fondo para el título
    doc.setFillColor(200, 220, 255); // Un azul claro
    doc.rect(0, 10, 210, 20, 'F'); // Cubre el ancho completo de una página A4
    doc.addImage(imageURL, 'JPEG', 15, 10, 30, 20); // Ajusta las coordenadas y tamaño según sea necesario
    doc.setFontSize(18);
    const titleWidth = doc.getStringUnitWidth(reportTitle) * doc.internal.getFontSize() / doc.internal.scaleFactor;
    const centerX = (doc.internal.pageSize.width - titleWidth) / 2;
    doc.text(reportTitle,centerX, 25);

    const tableColumn = ['Fecha', 'Nombre', 'Apellido', 'Correo Electrónico', 'Mapa', 'Tiempo Total'];
    const tableRows = patrols.map(patrol => [
        `${new Date(patrol.created).toLocaleDateString('es-ES')}`,
        patrol.user.name,
        patrol.user.lastName,
        patrol.user.email,
        patrol.map.name,
        `${Math.trunc(patrol.totalSeconds / 60)}m ${patrol.totalSeconds % 60}s`,
    ]);

    doc.autoTable({
        head: [tableColumn],
        headStyles: { fillColor: [0, 112, 192] },
        body: tableRows,
        startY: 40,
        styles: { cellPadding: 3, fontSize: 10 }
    });

    doc.save('reporte-patrullajes.pdf');
};

