const exportAmbushTasksByUserPdf = async (ambushes, reportTitle) => {
    const doc = new jsPDF();

    // Cargar la imagen desde un URL o usar una imagen en base64
    // Agregar image
    

    // Añadir un rectángulo de fondo para el título
    doc.setFillColor(200, 220, 255); // Un azul claro
    doc.rect(0, 10, 210, 20, 'F'); // Cubre el ancho completo de una página A4
    doc.addImage(imageURL, 'JPEG', 15, 10, 30, 20); // Ajusta las coordenadas y tamaño según sea necesario

    doc.setFontSize(18);
    // Centrar el título después de la imagen
    const titleWidth = doc.getStringUnitWidth(reportTitle) * doc.internal.getFontSize() / doc.internal.scaleFactor;
    const centerX = (doc.internal.pageSize.width - titleWidth) / 2;
    doc.text(reportTitle, centerX, 25); // Ajustar la posición vertical según sea necesario

    const tableColumn = ['Fecha', 'Nombre', 'Rol', 'Calificación', 'Tareas Cumplidas', 'Tareas No Cumplidas', 'Estado'];
    const tableRows = ambushes.map(ambush => [
        `${new Date(ambush.patrol.created).toLocaleDateString('es-ES')}`,
        `${ambush.patrol.user.name} ${ambush.patrol.user.lastName}`,
        ambush.rol,
        ambush.qualification.toFixed(1),
        formatTasks(ambush.tasksCompleted),
        formatTasks(ambush.tasksNotCompleted),
        ambush.state
    ]);

    doc.autoTable({
        head: [tableColumn],
        body: tableRows,
        startY: 40, // Iniciar la tabla después del título y el logo
        styles: { 
            cellPadding: 3, 
            fontSize: 10,
            overflow: 'linebreak'
        },
        headStyles: { fillColor: [0, 112, 192] },
        columnStyles: {
            0: { cellWidth: 20 },
            1: { cellWidth: 30 },
            2: { cellWidth: 30 },
            3: { cellWidth: 15 },
            4: { cellWidth: 35 },
            5: { cellWidth: 35 },
            6: { cellWidth: 25 }
        },
        theme: 'grid'
    });

    doc.save(`${reportTitle.replace(/ /g, '_').toLowerCase()}.pdf`);
};

function formatTasks(taskString) {
    if (!taskString) return "Ninguna";
    return taskString.split(',').map((task, index) => `${index + 1}.- ${task.trim()}`).join('\n');
}



export {exportPatrolsPdf, exportCombatsPdf, exportAmbushTasksByUserPdf, exportRecognitionsPdf}